htmx.defineExtension("client-side-templates",{transformResponse:function(e,t,n){var r=htmx.closest(n,"[mustache-template]");if(r){var a=JSON.parse(e),s=r.getAttribute("mustache-template");if(i=htmx.find("#"+s))return Mustache.render(i.innerHTML,a);throw"Unknown mustache template: "+s}s=htmx.closest(n,"[handlebars-template]");if(s){var a=JSON.parse(e),u=s.getAttribute("handlebars-template");return Handlebars.partials[u](a)}n=htmx.closest(n,"[nunjucks-template]");if(n){var i,a=JSON.parse(e),u=n.getAttribute("nunjucks-template");return(i=htmx.find("#"+u))?nunjucks.renderString(i.innerHTML,a):nunjucks.render(u,a)}return e}});